import React from 'react'
import './SongRow.css'

function SongRow({ track="Tiesto" }) {
  return (
    <div className='songRow'>
      <img src={track.album.image[0]} />
       <div className="songRowInfo">
              <h1>{track.name}</h1>
              <p>
                     {track.artists.map((artist) => artist.name).join(", ")}
                     {track.album.name}
              </p>
       </div>
    </div>
  )
}

export default SongRow
